import tensorflow as tf
import numpy as np
from matplotlib import pyplot as plt

X = tf.cast(tf.constant(np.random.randint(1,1000,1000)),dtype = tf.float32)
Y = tf.cast(tf.constant(X+8),dtype = tf.float32)

X,Y

plt.scatter(X,Y)

X = tf.reshape(X, (1000, 1))
Y = tf.reshape(Y, (1000, 1))
X,Y

x_train, y_train = X[:800], Y[:800]
x_test, y_test = X[800:], Y[800:]

# Build a model
model = tf.keras.Sequential() # Sequential API is the most frequesntly used model definition
model.add(tf.keras.layers.Dense(100,activation = 'relu'))
model.add(tf.keras.layers.Dense(100,activation = 'relu'))

model.add(tf.keras.layers.Dense(1)) # Creating 3 hidden layers

# Compile the model
model.compile(loss = 'huber',optimizer = tf.keras.optimizers.Adam(lr=0.1),metrics = ['mse'])

# Fit the model
model.fit(x_train,y_train,epochs = 100, verbose = 1)

y_pred = model.predict([500])
y_pred

from tensorflow.keras.utils import plot_model # The Architecture of our model can be visualised!
plot_model(model = model, show_shapes = True, to_file = "model.png")

