import tensorflow as tf
from tensorflow.keras.utils import plot_model
import pandas as pd
import numpy as np
import matplotlib.pyplot as plt
from sklearn.compose import make_column_transformer
from sklearn.preprocessing import MinMaxScaler, OneHotEncoder
from sklearn.model_selection import train_test_split

data = pd.read_csv("/content/insurance.csv")
data.head()

ct = make_column_transformer((MinMaxScaler(),['age','bmi','children'])
                                ,(OneHotEncoder(handle_unknown="ignore"),['sex','smoker','region']))
# Normalising and encoding all the columns

x = data.drop("charges",axis = 1) # 1 refers columns while 0 refers rows
y = data["charges"]

x_train, x_test , y_train, y_test = train_test_split(x,y,test_size = 0.3, random_state = 42)

ct.fit(x_train) # Fitting the x data in the column transformer

x_train_norm = ct.transform(x_train)
x_test_norm = ct.transform(x_test)

x_train_norm

model = tf.keras.Sequential()
model.add(tf.keras.layers.Dense(100))
model.add(tf.keras.layers.Dense(100))
model.add(tf.keras.layers.BatchNormalization())
model.add(tf.keras.layers.Dense(1))

model.compile(loss='mse',optimizer = "Adagrad",metrics = ["mse"])

model.fit(x_train_norm,y_train,epochs = 100,verbose = 1)

model.evaluate(x_test_norm,y_test)

